import React, { Component } from 'react';
import './App.css';
import './components/layout/Navbar';
import Navbar from './components/layout/Navbar';

class App extends Component {
  render() {
    return <Navbar title='Github Finder' icon='fab fa-github' />;
  }
}
export default App;
